    def process(self):
        print(f"Processing video stream {self.stream_id}...")

class VideoProcessor:
    def __init__(self, queue):
        self.queue = queue

    def process_stream(self):
        while True:
            stream = self.queue.get()
            if stream is None:
                break
            stream.process()
            self.queue.task_done()

def producer(queue, stream_id):
    stream = VideoStream(stream_id)
    queue.put(stream)

