class Stack:
    def __init__(self):
        self.items = []

    def push(self, item):
        self.items.append(item)

    def pop(self):
        return self.items.pop()

    def is_empty(self):
        return len(self.items) == 0

    def size(self):
        return len(self.items)

    def resize(self, capacity):
        self.items = [None] * capacity
        for i in range(min(capacity, len(self.items))):
            self.items[i] = self.items.pop(0)

